import React from 'react'
import '../index.css'
import BuchenLogic from './buchenLogic';
import Zimmer from './requirements/zimmer';


export default class popupContent extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      zimmername: props.zimmername,
      standort: props.standort,
      stockwerk: props.stockwerk,
      maxP: props.maxP,
      setModal: false
    };
  }

  render() {
    
    return (
      <div className='buchen-main'>
        <h1>hallo</h1>
        <button className='closePopUp' onClick={<Zimmer showModal={this.state.setModal}/>}>Close Buchung</button>
        <BuchenLogic showModal={this.state.setModal} />
        </div>
    )
  }

}
